import { fetchData } from '../api/api';
import { observable, action, decorate } from 'mobx';

class AppStore {
    test = {};

    handleSearch = (query) => {
        fetchData(query).then((resp) => {
                console.log('resp', resp);
            })
    }
}

export default decorate(AppStore, {
    test: observable,
    handleSearch: action
});
